            <img
              src={avatar} alt={search.artist}
            />
          </div>
          <ul className="social-icons">
            <li>
              <a href="/">
                <i className="fa fa-see" onClick={() => history.push(`/${id}`)}></i>
              </a>
            </li>
            <li>
              <a href="/">
                <i className="fa fa-delete" onClick={() => handleDeleteSong(id)}></i>
              </a>
            </li>
            <li>
              <a href="a">
                <i className="fa fa-twitter"></i>
              </a>
            </li>
          </ul>
          <div className="details">
            <h2>
            {search.artist} <span className="job-title">{search.song}</span>
            </h2>
          </div>
        </div>

      </div>
    // <div style={avatarStyles}>
    //   <div  onClick={() => handleDirection(id)}>
    //     <img src={avatar} alt={search.artist} />
